+----------------+
|Game Description|
+----------------+

Hordes of banana-hungry bugs are ravaging the village food supply and you're the only monkey brave enough to take them on! Shoot ropes to wall off bugs and stop them in their tracks. This easy-to-learn game has tons of a-peel!

Originally released June 2nd, 2010.

+----------------------------------+
|Instructions / System Requirements|
+----------------------------------+

No install or crack is required for this portable version. Extract the ZIP file and create a shortcut to the executable (EXE) to play.

This game is compatible with Windows XP SP2, Vista(32/64bit) and 7(32/64bit). Requires DirectX 9.0c or later. Processor requirements: 1.2GHz CPU or higher. RAM requirements: 512 MB or higher. Requires a DirectX-compatible Sound and Video card with at least 32 MB of video memory.

